import Card from "./Card"
import data from "./../data"

export default function Main() {
    const cards = data.map(place => {
        if (place.name !== "" && place.description !== "" && place.country !== "" && place.date !== "" && place.image !== "" && place.link !== "") {
            return (
                <Card
                    key={place.id}
                    place={place}
                />
            )
        }
    })

    return (
        <main className="main">
            {cards}
        </main>
    )
}
